import React from 'react';
import chopaImage from './images/welcome.jpg'; // Assuming the image is in the same directory as Chopa.js

function Chopa() {
  return (
    <div>
      <h1>Chopa</h1>
      <p>Speed boat commonly known as <b>chopa</b> in the region<br/></p>
      <img src={chopaImage} alt="the speed boat" title="chopa"/>
      <p>
        The speed boat moves from lunda to mbita in a duration of ten to twenty minutes. It depends on the power propelling it and it costs 200ksh. It only carries passengers, usually about ten passengers or less. It's also available for hire.
      </p>
    </div>
  );
}

export default Chopa;
